import React, {useState} from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet'
import './App.scss';

function App() {
  const [modal, setModal] = useState(false);

  const toggleModal = () => {
      setModal(!modal);
  };

  if (modal){
    document.body.classList.add('active-modal')
  } else{
    document.body.classList.remove('active-modal')
  }

  return(
      <>
      <button onClick={toggleModal} className="btn-modal x">
          2019
      </button>

      {modal && (<div className="modal">
          <div className="overlay" onClick={toggleModal}>

          </div>
          <div className="modal-content x">

              <MapContainer center={[51.505, -0.09]} zoom={13} scrollWheelZoom={false}>
  <TileLayer
    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
  />
  <Marker position={[51.505, -0.09]}>
    <Popup>
      A pretty CSS3 popup. <br /> Easily customizable.
    </Popup>
  </Marker>
</MapContainer>
              <button className='close-modal'
              onClick={toggleModal}>
                Close
              </button>

          </div>
          </div>

          )}

<button onClick={toggleModal} className="btn-modal y">
          2020
      </button>

      {modal && (<div className="modal">
          <div className="overlay" onClick={toggleModal}>

          </div>
          <div className="modal-content y">

              <button className='close-modal'
              onClick={toggleModal}>
                Close
              </button>

          </div>
          </div>

          )}

<button onClick={toggleModal} className="btn-modal z">
          2021
      </button>

      {modal && (<div className="modal">
          <div className="overlay" onClick={toggleModal}>

          </div>
          <div className="modal-content z">

              <button className='close-modal'
              onClick={toggleModal}>
                Close
              </button>

          </div>
          </div>

          )}


      </>
  );
}

export default App;
